        public static GUIStyle WrappableLabel
        {
            get
            {
                if (wrapableText == null)
                {
                    wrapableText = new GUIStyle(EditorStyles.label);
                    wrapableText.normal.textColor = EditorStyles.label.normal.textColor;
                    wrapableText.wordWrap = true;
                }
                return wrapableText;
            }
        }

        public static GUIStyle AboutWindowLabel11
        {
            get
            {
                if (aboutWindowLabels11 == null)
                {
                    aboutWindowLabels11 = new GUIStyle(EditorStyles.label);
                    aboutWindowLabels11.normal.textColor = EditorStyles.label.normal.textColor;
                    Font myFont = (Font)Resources.Load("Fonts/Tahoma_11", typeof(Font));
                    aboutWindowLabels11.normal.textColor = Color.white;

                    if (myFont != null)
                    {
                        aboutWindowLabels11.font = myFont;
                    }
                    else
                    {
                        aboutWindowLabels11.fontSize = 10;
                    }
                   
                    
                    
                }
                return aboutWindowLabels11;
            }
        }
